import React, { Component } from 'react';

class YouTubeData extends Component {
  constructor(props) {
    super(props);

    this.state = { data: [] }
  }

  // called from auth child
  UpdateUser = (userID, name, email, accessToken) => {

    let user = {
      userID: userID,
      name: name,
      email: email,
      accessToken: accessToken
    }

    this.setState({ user: user });
  }

  // FetchData = async () => {
  //
  // }

  render() {

    if (this.props.target === "YouTube") {
      var Auth = <YouTubeAuth UpdateUser={this.UpdateUser}/>;
    } else {
      var Auth = "Please supply a configured target";
    }

    return(
      <div className="Social">
        <h2>{this.props.target}</h2>
        {Auth}
      </div>
    );

  }
}

export default Social;
